import React from 'react';
import {useState, useEffect} from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

function GetData() {
  const [data, setData] = useState({});
  useEffect(() => {
    fetch("/manager/employee-list").then(res => res.json()).then(data => setData(data))
  }, [])
  console.log(data);
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
